import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import App2 from './second';

ReactDOM.render(
  <React.StrictMode>
    const name = ""
    <div><h2>{App2("Raghav")}</h2></div>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

